'use strict'
import 'antd/dist/antd.css'; 
import '@shopify/polaris/styles.css'
import dynamic from 'next/dynamic'
const AppProviderDynamic = dynamic(() =>
  Promise.resolve(require('@shopify/polaris').AppProvider)
)
import { Page, Card, PageActions } from "@shopify/polaris";
import {  Row, Col } from "antd";


export default class Mocker extends React.Component{


    render () {
        return (
       <AppProviderDynamic>
<Page fullWidth>


<Row>
          <Col span={10}>
          hll
          </Col>

          <Col>
          <Page
  singleColumn
  breadcrumbs={[{content: 'Orders', url: '/orders'}]}
  title="Add payment method"
  primaryAction={{content: 'Save', disabled: true}}
>
  <Card title="Credit card" sectioned>
    <p>Credit card information</p>
  </Card>
  <PageActions
    primaryAction={{content: 'Save', disabled: true}}
    secondaryActions={[{content: 'Delete'}]}
  />
</Page>
          </Col>
         </Row>


</Page>

       </AppProviderDynamic> 
        )
    }
}
